    return (
        <div >
            <div className="order-item">{orderCur.client_name}</div>
            <div className="order-item">{orderCur.city}</div>
            <div className="order-item">{orderCur.date_to_send}</div>
            <div className="order-item">{orderCur.status}</div>
            <div className="order-item">{orderCur.payment_status}</div>
            <div className="order-item"></div>
            <div className="order-item"></div>
        </div>
    );
};

export default OrderItem;
